import React from "react";
import FilesInDisplay from "../FilesInDisplay";
import UserInputControl from "../UserInputControl";
const FormSteps = (step, setStep, files, setFiles) => [
  {
    title: "Choose a file",
    content: <FilesInDisplay setStep={setStep} step={step} />,
  },
  {
    title: "enter Use Details",
    content: <UserInputControl setStep={setStep} step={step} />,
  },
  {
    title: "Confirmatory Page",
    content: <p files={files}>confirmatory Page </p>,
  },
];
export default FormSteps;
